import React from 'react';
import { BiChevronRight, BiChevronLeft } from "react-icons/bi";
import Heading from '../Heading';


function Password({ showSubContent, setshowSubContentClick }) {

    return (
        <div>
            <h1 onClick={() => setshowSubContentClick(0)} >
                    <BiChevronLeft
                      className=""
                    />
                    <Heading content={`${<BiChevronLeft />} Password `} className="me-2 d-inline-block d-sm-none" />
                  </h1>
            vvv {showSubContent}

        </div>
    )
}

export default Password
